r(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"8bed525a-ef22-4f22-abba-cc910e2bec8b","type":"CustomJS"},{"attributes":{},"id":"29065739-4ba6-4d0c-816c-8efb9a870f77","type":"ResetTool"},{"attributes":{"formatter":{"id":"0de726a1-4dbc-4c0a-8c86-fc548cb0b16d","type":"BasicTickFormatter"},"plot":{"id":"c3af505d-4765-41b0-b003-cc86fcdaf2d3","subtype":"Figure","type":"Plot"},"ticker":{"id":"ad8548ae-6c0c-4b0e-b505-dcf8c7be1ce1","type":"BasicTicker"}},"id":"0bc4c6d8-44e1-4ea4-8c50-dc549a6ed265","type":"LinearAxis"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"70c570af-8cbe-4216-bed2-03af3c659cf8","type":"Circle"},{"attributes":{"callback":null},"id":"e6f8d73d-562d-4580-8e51-9cd7187ed029","type":"DataRange1d"},{"attributes":{},"id":"05189bfc-4217-4921-b967-8a218744352f","type":"PanTool"},{"attributes":{},"id":"ce895a29-bb53-456d-ad06-1bdc62187e3e","type":"BasicTickFormatter"},{"attributes":{"callback":null},"id":"e452814a-68c6-4ba4-82cc-7f26d76e6655","type":"DataRange1d"},{"attributes":{},"id":"5b44e906-46eb-44b8-be00-6c5ac996e4ff","type":"BasicTicker"},{"attributes":{"plot":{"id":"c3af505d-4765-41b0-b003-cc86fcdaf2d3","subtype":"Figure","type":"Plot"},"ticke
